namespace Elementor;
class CertainDev_ObjectsDecoration{
	public static $objects;
	function __construct(){
	}

	public static function get_object($objectId, $color = []){
		$svg = $fill = $gradient = '';
		$objectsArray = CertainDev_ObjectsDecoration::get_objects_list_full();		
		if(array_key_exists($objectId,$objectsArray)){
			if($color != ''){
				$colorValue = CertainDev_Icons::set_icon_color($color);
				$fill = ($colorValue['type'] == 'color') ? ' fill="'.$colorValue['value'].'" style="color:'.$colorValue['value'].';" '  : ' style="fill:url(#'.$colorValue['id'].');"  fill="url(#'.$colorValue['id'].')" ';
				$gradient = ($colorValue['type'] == 'gradient') ? $colorValue['value'] : '';
			}
			$objectsArray[$objectId]['icon'] = str_replace("<svg ", "<svg ".$fill,$objectsArray[$objectId]['icon']);
			$objectsArray[$objectId]['icon'] = str_replace("</svg>", $gradient."</svg>" ,$objectsArray[$objectId]['icon']);
			$svg = $objectsArray[$objectId]['icon'];
		}
		return $svg;
	}


	public static function get_objects_list(){
		return elb_get_option('objects_decoration');
	} 

	public static function get_objects_list_full(){
		return array_merge(elb_get_option('objects_decoration'), CertainDev_ObjectsDecoration::$objects);
	} 

	public static function get_objects_list_final(){
		if(!elb_check_pro_version())
			echo json_encode(\Elementor\CertainDev_ObjectsDecoration::$objects);
		else
			echo json_encode(\Elementor\CertainDev_ObjectsDecoration::get_objects_list_full());
	}

	public static function get_objects_list_JS(){
		if(!elb_check_pro_version())
			return json_encode(\Elementor\CertainDev_ObjectsDecoration::$objects);
		else
			return json_encode(\Elementor\CertainDev_ObjectsDecoration::get_objects_list_full());
	}

}

